// SPDX-License-Identifier: BUSL-1.1
pragma solidity >=0.5.0;


/// @title An interface for a contract that is capable of deploying Uniswap V3 Pools
/// @notice A contract that constructs a pool must implement this to pass arguments to the pool
/// @dev This is used to avoid having constructor arguments in the pool contract, which results in the init code hash
/// of the pool being constant allowing the CREATE2 address of the pool to be cheaply computed on-chain
interface IUpsideV1PoolDeployer {
    /// @notice Get the parameters to be used in constructing the pool, set transiently during pool creation.
    /// @dev Called by the pool constructor to fetch the parameters of the pool
    /// Returns factory The factory address
    /// Returns token0 The first token of the pool by address sort order
    /// Returns token1 The second token of the pool by address sort order
    /// Returns fee The fee collected upon every swap in the pool, denominated in hundredths of a bip
    /// Returns tickSpacing The minimum number of ticks between initialized ticks
    function parameters()
        external
        view
        returns (
            address owner,
            address factory,
            uint24 fee
        );
}

contracts/UpsideV1PoolDeployer.sol.content:
// SPDX-License-Identifier: BUSL-1.1

pragma solidity ^0.8.0;

import "./interfaces/IUpsideV1PoolDeployer.sol";

import "./UpsideV1Pool.sol";


contract UpsideV1PoolDeployer is IUpsideV1PoolDeployer {
    struct Parameters {
        address owner;
        address factory;
        uint24 fee;
    }

    Parameters public override parameters;

    function deploy(
        address factory,
        address owner,
        uint24 fee
    ) internal returns (address pool) {
        parameters = Parameters({factory: factory, owner: owner, fee: fee});
        pool = address(new UpsideV1Pool{salt: keccak256(abi.encode(owner, fee))}());
        delete parameters;
    }
}

